import React from 'react'
import './cards.css'
import { CardsData } from '../Data/Data'


const Cards = () => {
  return (
    <div className="Cards">
        {CardsData.map((item, index) => {
            return(
               <div className="status-card">
                <div className="logo-part">
                    <item.icon/>
                    <span>
                        {item.title}
                    </span>
                </div>
                <div className="percent-part">
                    <item.trendIcon/>
                    <span>
                        {item.per}
                    </span>
                </div>
                <div className="count-part">
                    <span>
                        {item.count}
                    </span>
                </div>
               </div>
            )
        })}
    </div>
  )
}

export default Cards
